import { Route, Link, Switch } from 'react-router-dom';
import './menu.css';
class header extends Component {

  render() {

    return (
        <header>
            <span>메인으로</span>
            <div class="Line-2"></div>
            <span>정책사이트 보기</span>

        </header>
    );
  }
}

export default header;
